<?xml version="1.0" encoding="UTF-8"?>
<!DOCTYPE html>
<html xmlns:wicket="http://wicket.apache.org/dtds.data/wicket-xhtml1.4-strict.dtd">
<body>
<wicket:panel>
	<div class="feedback-panel">
		<wicket:enclosure child="FATALfeedbackPanel">
			<div class="feedback-level-outer fatal">
				<div wicket:id="FATALfeedbackPanel" class="feedback-level">
				</div>
			</div>
		</wicket:enclosure>
		<wicket:enclosure child="ERRORfeedbackPanel">
			<div class="feedback-level-outer error">
				<div wicket:id="ERRORfeedbackPanel" class="feedback-level">
				</div>
			</div>
		</wicket:enclosure>
		<wicket:enclosure child="WARNINGfeedbackPanel">
			<div class="feedback-level-outer warning">
				<div wicket:id="WARNINGfeedbackPanel" class="feedback-level">
				</div>
			</div>
		</wicket:enclosure>
		<wicket:enclosure child="SUCCESSfeedbackPanel">
			<div class="feedback-level-outer success">
				<div wicket:id="SUCCESSfeedbackPanel" class="feedback-level">
				</div>
			</div>
		</wicket:enclosure>
		<wicket:enclosure child="INFOfeedbackPanel">
			<div class="feedback-level-outer info">
				<div wicket:id="INFOfeedbackPanel" class="feedback-level">
				</div>
			</div>
		</wicket:enclosure>
		<wicket:enclosure child="DEBUGfeedbackPanel">
			<div class="feedback-level-outer debug">
				<div wicket:id="DEBUGfeedbackPanel" class="feedback-level">
				</div>
			</div>
		</wicket:enclosure>
		<wicket:enclosure child="UNDEFINEDfeedbackPanel">
			<div class="feedback-level-outer undefined">
				<div wicket:id="UNDEFINEDfeedbackPanel" class="feedback-level">
				</div>
			</div>
		</wicket:enclosure>
	</div>
</wicket:panel>
</body>
</html>
